import React from 'react';
import TextField from '@mui/material/TextField';
import Box from '@mui/material/Box';

export default function DatePickers({value, onChange}) {
  return (
    <Box
      component="form"
      sx={{
        display: 'flex',
        flexWrap: 'wrap',
        '& .MuiTextField-root': {
          m: 1,
          width: '100%',
        },
      }}
      noValidate
    >
      <TextField
        id="date"
        type="date"
        defaultValue="2017-05-24"
        value={value}
        onChange={onChange}
        InputLabelProps={{
          shrink: true,
        }}
        value={value}
        onChange={onChange}
      />
    </Box>
  );
}
